import React from 'react';
import { Link } from 'react-router-dom';
import logo from '../images/logo.png';

function NavBarLogin1() {

    return (
        <nav className="navbar navbar-expand-sm bg-secondary navbar-dark sticky-top justify-content-end">
           <Link className="nav-link" to="/home"><img className="card-img-top" src={logo} style={{width:"35px",height:"35px"}} alt="Card image" /></Link>

            <ul className="navbar-nav">
                           
                
                
                <li className="nav-item">
                    <Link className="nav-link" to="/user/add">Register</Link>
                </li>
                <li className="nav-item">
                    <Link className="nav-link" to="/home">Logout</Link>
                </li>
                
                
            </ul>
        </nav>
    )
}



export default NavBarLogin1;
